import React from "react";
import classes from "./headMenu.module.scss";
import AngleDown from "../../trifles/icons/AngleDown";

const headMenu = () => {
  const categories = [
    "Mew",
    "Memew",
    "Mew",
    "Memew",
    "Mew",
    "Memew",
    "Mew",
    "Memew",
    "Mew",
    "Memew"
  ];

  return (
    <div className={classes.headMenu}>
      {categories.map((item) => (
        <span className={classes.point} key={Date.now() + Math.random()}>
          {item}
          <AngleDown />
        </span>
      ))}
    </div>
  );
};

export default headMenu;
